import React from "react";

const Sticky = ({colour, angle, title, text}) =>{
    return (
        <div>
            <div className="px-5 py-5 w-40 min-h-40 " style={{backgroundColor: colour,  rotate: angle}}></div>
            <div className="px-5 py-5 w-40 min-h-40 " style={{backgroundColor: colour,  rotate: angle}}>
            {title === 'NULL' ? (
                <>
                    <p>{text}</p>
                </>
            ) : (
                <>
                    <h1>{title}</h1>
                    <p>{text}</p>
                </>
            )}

        </div>
        </div>

    );
};

export default Sticky;
